import React, {useState} from 'react';
import TinderCard from "react-tinder-card";

function TinderCards() {
    const [people,setPeople]=useState([{
        name:'Aya',
        url: ''
    },
    {
        name: 'Dani',
        url: ''
    }]);

    return(
        <div>
            <h1>TinderCards</h1>
            {people.map(person => (
                <TinderCard></TinderCard>
            ))}
        </div>
    );
}

export default TinderCards;
